import React from "react";
import FormModal from "./FormModal";

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import CustomNavbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

import "bootstrap/dist/css/bootstrap.min.css";

export default function ZNavbar()
{

  //alert('Nav-No: ' + Math.random(1000));
  
  const showModal = React.useRef(false);
  const formModalKey = React.useRef(1);
  const [refresh, setRefresh] = React.useState(false);

  const handleShow= (e) =>{
    e && e.preventDefault();
    
    showModal.current = true;
    //alert("ShowModel::" + showModal.current);
    setRefresh(!refresh);
    
  }

  formModalKey.current = formModalKey.current + 1;

  return (
  <>
    <CustomNavbar bg="dark" data-bs-theme="dark" >
        <Container>
        <CustomNavbar.Brand href="#home">
        <img src="https://media.geeksforgeeks.org/wp-content/uploads/20210425000233/test-300x297.png"
          alt="Sample Brand Logo"
          width="35"
          className="align-top d-inline-block"
          height="35"
        />ZEBRA.AI
      </CustomNavbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Suggestions</Nav.Link>
          </Nav>
        </Container>
      </CustomNavbar>

    {showModal.current && <FormModal showModal={true} key={formModalKey.current}></FormModal>}
  </>
  );

}
